import React from 'react'

//Bootstrap
import Container from "react-bootstrap/Container";

function Stats(props) {
    console.log(props);

    const confirmed = props.confirmed.map(location =>
    <div>
        <h3>{location.country}</h3>
        <p>{location.latest}</p>
    </div>)

    const dead = props.death.map(location =>
    <div>
        <p>{location.latest}</p>
    </div>)

    const recovered = props.death.map(location =>
    <div>
        <p>{location.recovered}</p>
    </div>)

    return (
        <div className='stats'>
            <Container>
                {dead}
                {recovered}
            </Container>
        </div>
    )
}

export default  Stats
